comments:
So today was one of the craziest days I've had, and I handled it like a pro! My girl is so proud of me!
I rode on the floor under her legs in her friends car while they drove for nearly an hour and a half, looking for a parking spot for the football game they'd been given tickets for. Half of downtown was shut down for the game and parking was impossible, so we ditched the idea of the game and went to my girl's favorite art museum instead! Then we walked through downtown and I got to meet a horse for the first time! I was very excited and confused, but I quickly learned to ignore the horses and carriages. I also sat in large groups of people to watch street performers, and navigated the enormous River Center Mall and River Walk, all while keeping a close eye on my girl!
We left downtown and stopped in a Chilli's for dinner, where I snoozed under the table when I wasn't watching my girl. We ended the night with a quick run to Wal-Mart for fabric and snacks, and now my girl and I are relaxing after the day we've had!
Aside from adults acting like they've never seen a dog before, a woman and her daughter who tried to sneak up to me behind my girl, and one unsupervised child who wanted me to eat her tiny bouncy ball, people didn't really bother us, but we have the group of friends who accompanied us to thank for that. They were amazing at spotting children and large crowds and placing themselves between them and us to make sure we'd be bothered as little as possible, and my girl is insanely grateful for their help. Downtown San Antonio on a weekend is a nightmare.
